const Comments = (props) => {
    return (
        <div>
            {post.comments.map((comment) => {
                return (
                    <div>
                        <Comment
                            key={comment[0].id}
                            comment={comment}
                            userId={props.userId}
                        />
                    </div>
                );
            })}
        </div>
    );
};
export default Comments;
